bpmn:scriptTask.ecos:script:
var decisions = document.load('decisions[]?id');

var ArrayList = Java.type('java.util.ArrayList');
var collection = new ArrayList(decisions.length);
decisions.forEach(function(el) {
  collection.add(el);
})
execution.setVariable('decisions', collection);

decisions.forEach(function(decisionRef) {
 var decision = Records.get(decisionRef);
 decision.att('_status', 'undone');
 decision.save();
});

